import React from 'react';
import SignedInFooter from '../Footer/SignedInFooter';

class Footer extends React.Component {
    render() {
        return (
            <div>
                <p>Please join us for our wedding celebration</p>
                <p>August 4th 2022</p>
                <p className="photocredit">Photo Credit: Brittany Fleming - Facebook: @bflemingphoto Instagram: @bflemingphotography</p>
            </div>
        )
    }
}

export default Footer;
